import '../css/maze.css'
import Grid from './grid.js'

function Maze() {
    var no_rows=new Array(10).fill(true)
    var no_columns=new Array(10).fill(true)
    return (
        <div className="maze">
            maze
           {no_rows.forEach(()=>{
                    no_columns.forEach(()=>{
                        return <Grid height="10px" width="10px" />
                    })
                })
            }
        </div>
    );
};

export default Maze;
